import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Header from './components/header';
import DoctorList from './components/doctorList';

function App() {
    return (
        <div>
            <BrowserRouter>
                <Switch>
                    <Route path="/">
                        <Header />
                        <DoctorList />
                        <DoctorList />
                        <DoctorList />
                    </Route>
                    <Route path="/reviews">
                        <Header />
                    </Route>
                </Switch>
            </BrowserRouter>
        </div>
    );
}

export default App;
